export class AppFactory {
  constructor(baseUrl) {
    this.baseUrl = baseUrl;
    this.links = {
      root: '/'
    };
  }

  setLinks(links) {
    this.links = links;
  }

  setLink(name, link) {
    this.links[name] = link;
  }
}
